import React from 'react';
import { Container, Grid, Typography, Link, Divider } from '@mui/material';
import { styled } from '@mui/material/styles';

const FooterContainer = styled('footer')({
  padding: '2rem 0',
  backgroundColor: '#f8f9fa',
  borderTop: '1px solid #e9ecef',
});

const FooterSection = styled(Grid)({
  marginBottom: '1rem',
});

const FooterTitle = styled(Typography)({
  fontWeight: 'bold',
  marginBottom: '0.5rem',
});

const FooterLink = styled(Link)({
  display: 'block',
  color: '#495057',
  textDecoration: 'none',
  marginBottom: '0.5rem',
  '&:hover': {
    textDecoration: 'underline',
  },
});

const Footer = () => {
  return (
    <FooterContainer>
      <Container>
        <Grid container spacing={4}>
          {/* Product Section */}
          <FooterSection item xs={12} sm={6} md={3}>
            <FooterTitle variant="h6">Product</FooterTitle>
            <FooterLink href="#">Overview</FooterLink>
            <FooterLink href="#">Features</FooterLink>
            <FooterLink href="#">Solutions</FooterLink>
            <FooterLink href="#">Tutorials</FooterLink>
          </FooterSection>

          {/* Company Section */}
          <FooterSection item xs={12} sm={6} md={3}>
            <FooterTitle variant="h6">Company</FooterTitle>
            <FooterLink href="#">About Us</FooterLink>
            <FooterLink href="#">Careers</FooterLink>
            <FooterLink href="#">Press</FooterLink>
            <FooterLink href="#">News</FooterLink>
          </FooterSection>

          {/* Resource Section */}
          <FooterSection item xs={12} sm={6} md={3}>
            <FooterTitle variant="h6">Resource</FooterTitle>
            <FooterLink href="#">Blog</FooterLink>
            <FooterLink href="#">Newsletter</FooterLink>
            <FooterLink href="#">Events</FooterLink>
            <FooterLink href="#">Help Center</FooterLink>
          </FooterSection>

          {/* Contact Section */}
          <FooterSection item xs={12} sm={6} md={3}>
            <FooterTitle variant="h6">Contact</FooterTitle>
            <FooterLink href="#">Contact Us</FooterLink>
            <FooterLink href="#">Support</FooterLink>
            <FooterLink href="#">FAQs</FooterLink>
          </FooterSection>
        </Grid>
        <Divider style={{ margin: '1rem 0' }} />
        <Typography variant="body2" align="center" color="textSecondary">
          Â© {new Date().getFullYear()} Your Company. All rights reserved.
        </Typography>
      </Container>
    </FooterContainer>
  );
};

export default Footer;
